  return (
    <div className="App">
      <nav >
      <NavLink to="/">
            <i className="glyphicon glyphicon-home"></i> <span>Home</span>
        </NavLink>
        <NavLink to="/">
            <i className="glyphicon glyphicon-camera"></i> <span>About</span>
        </NavLink>
      </nav>

